Розвиток&amp;nbsp;творчості:&amp;nbsp;ідеально підходить для розвитку уяви та будівельних навичок маленьких будівельників.
Улюблений&amp;nbsp;персонаж:&amp;nbsp;діти можуть пережити нові захоплюючі пригоди з&amp;nbsp;Кремезом та його командою.

Порадуйте свою дитину унікальним транспортним засобом із&amp;nbsp;серії&amp;nbsp;Кремез і команда&amp;nbsp;і відчуйте, як веселощі та творчість оживають у кожній грі!

У набір входить транспортний засіб і фігурка Викрута;
автомобіль оснащений світловими та звуковими ефектами;
Розміри упаковки: приблизно 43,5 x 36 x 13 см;
Розміри автомобіля: 36 х 20 х 13 см;
Висота фігурки: 6,5 см;
Необхідні батареї: 3 x AG13 (входять в комплект);
Іграшка підходить для дітей&amp;nbsp;від 3 років.

Пориньте&amp;nbsp;у світ будівельних пригод з унікальним Будівельним автомобілем-трансформером делюкс &quot;Бульдозер Кремеза&quot;! Завдяки&amp;nbsp;світловим і звуковим ефектам та рухоми елементам&amp;nbsp;ця інтерактивна іграшка&amp;nbsp;переносить кожного маленького&amp;nbsp;будівельника прямо в центр захоплюючих місій.
Бульдозер&amp;nbsp;не тільки ретельно деталізований, але також має&amp;nbsp;реалістичне світло та звуки, які роблять розвагу ще більш автентичною. Рухомі&amp;nbsp;частини&amp;nbsp;можна використовувати для відтворення реальних будівельних завдань, що заохочують дитячу уяву та майстерність. У набір також входить&amp;nbsp;фігурка Кремеза, яку можна розташувати&amp;nbsp;в транспортному засобі.
Чому варто обрати автомобіль із&amp;nbsp;серії &quot;Кремез і команда&quot;&amp;nbsp;

Світлові та звукові ефекти:&amp;nbsp;іграшка оснащена реалістичним світлом і звуками, які оживляють кожну гру.
Рухомі частини:&amp;nbsp;багато різних будівельних сцен можна відтворити за допомогою інтерактивних частин бульдозера.
Високоякісна конструкція:&amp;nbsp;міцні матеріали гарантують довговічність і безпеку під час гри.
Розвиваюча функція:&amp;nbsp;ідеально підходить для&amp;nbsp;розвитку уяви маленьких будівельників.
Улюблений персонаж:&amp;nbsp;діти можуть пережити нові захоплюючі пригоди з Кремезом та його командою.

Порадуйте свою дитину унікальним&amp;nbsp;ігровим набором&amp;nbsp;із&amp;nbsp;серії &quot;Кремез і команда&quot; (Rubble &amp;amp; Crew)&amp;nbsp;і подивіться, як радість і творчість оживають у кожній грі!

У набір входить транспортний засіб і фігурка Кремеза;
автомобіль оснащений світловими та звуковими ефектами;
Розміри упаковки: приблизно 43,5 x 36 x 14 см;
Розміри автомобіля: 38 х 19 х 14 см;
Висота фігурки: 6,5 см;
Необхідні батареї: 3 x LR44 (AG13) - входять в набір;
Іграшка підходить для дітей&amp;nbsp;від 3 років.

Базовий будівельний автомобіль з фігуркою Викрута - це ігровий набір, що подарує море задоволення прихильникам будівельних пригод. В наборі фігурка цуценяти Викрута та його будівельний автомобіль - самоскид.&amp;nbsp;
Ця іграшкова вантажівка виконана з міцного пластику, має справжні робочі колеса, рухомий ролик і робочу платформу самоскида, тому вона є обов&amp;rsquo;язковою для шанувальників та колекціонерів будівельної техніки.&amp;nbsp;
Діти обожнюють&amp;nbsp;разом зі своїми батьками або самостійно грати з улюбленими цуценятами та їх автомобілями, використовувати свою уяву і відтворювати улюблені будівельні завдання.&amp;nbsp;
Для ще більш захоплюючих пригод збирайте колекцію ігрових наборів&amp;nbsp;&quot;Кремез і команда&quot; (Rubble &amp;amp; Crew) з кінетичним піском, щоб продовжувати будувати навіть вдома (кожен продається окремо)!
Насолоджуйтесь безперервними будівельними пригодами з вашими улюбленими цуценятами! Конструктори та сенсорні іграшки &quot;Кремез і команда&quot; створені, щоб дарувати дітям і батькам можливість будувати, грати та вчитися разом!
Підходять для дітей віком від 3 років.

Базовий будівельний автомобіль з фігуркою Кремеза - це ігровий набір, що подарує нескінчені розваги на вулиці та вдома.&amp;nbsp;
В набір входить фігурка Кремеза та його&amp;nbsp;автомобіль-бульдозер. Ця іграшкова вантажівка має рухомі колеса, рухомий ковш і робочий екскаватор,&amp;nbsp;тому&amp;nbsp;є обов&amp;rsquo;язковим в колекції будівельної техніки.&amp;nbsp;Діти обожнюють&amp;nbsp;грати зі своєю будівельною технікою та улюбленим цуценям, використовувати свою уяву, щоб відтворити улюблені будівельні завдання.&amp;nbsp;
Для ще більш захоплюючих пригод збирайте колекцію ігрових наборів&amp;nbsp;&quot;Кремез і команда&quot; (Rubble &amp;amp; Crew) з кінетичним піском, щоб будувати навіть вдома (кожен продається окремо)!
Насолоджуйтесь безперервними будівельними пригодами з вашими улюбленими цуценятами! Конструктори та сенсорні іграшки &quot;Кремез і команда&quot; створені, щоб дарувати дітям і батькам можливість будувати, грати та вчитися разом!
Підходять для дітей віком від 3 років.

Заряд &amp;ndash; це цуценя з команди Кремеза. Він має зелені очі, завжди носить червоне вбрання та бейсболку. Заряд завжди готовий попрацювати своїм будівельним грейфером, щоб допомогти в будь-якій ситуації, коли потрібна важка техніка. Червоний транспортний засіб дуже деталізований, має рухомі колеса та підйомну раму, до якої кріпиться рухомий захват. Він виготовлений з високоякісного пластику, що надає йому міцності та довговічності.&amp;nbsp;
Базовий будівельний автомобіль з фігуркою Заряда - це ідеальна іграшка для маленьких шанувальників Щенячого патруля, які можуть відтворювати улюблені сцени з фільмів і телесеріалів і використовувати свою уяву для створення власних пригод. Заряд і його автомобіль є не тільки іграшкою, а й предметом колекціонування для шанувальників Кремеза і команди.

Виробник:&amp;nbsp;Spin Master;
Розміри автомобіля: 8 х 19 х 11 см;
Розмір упаковки: 23 х 23 х 10 см;
Іграшка&amp;nbsp;підходить для дітей&amp;nbsp;від 3 років.

Приєднуйтеся до свого улюбленого цуценя Кремеза, щоб створити захоплюючу будівельну гру з ігровим набором &amp;laquo;Майстерня Кремеза&amp;raquo; з кінетичним піском!
Набір містить будівельні іграшки та іграшкові інструменти, такі як дриль і рухома торцювальна пила, а також 85 г кінетичного піску, який є розвиваючою сенсорною іграшкою для дітей. Його можна використовувати для створення формованих колод і будівельних блоків, а потім просверлити в них отвори та&amp;nbsp;подрібнювати їх за допомогою іграшкових інструментів, щоб створювати ще більше інноваційних будівельних проєктів!
Цей дивовижний ігровий набір також включає іграшкову фігурку Кремеза висотою 5 см, тож діти та їхні батьки можуть відтворювати свої улюблені сцени з мультфільму та створювати власні будівельні пригоди!
До набору входять:

1 майстерня;
1 фігурка Кремеза;
1 форма для колод;
2 інструменти для майстерні;
кінетичний пісок (85 г).

Підходить для дітей віком від 3 років.

&quot;Кремез і команда&quot;&amp;nbsp;&amp;mdash; це захоплюючий мультсеріал, який переносить дітей у світ, повний пригод і будівельних завдань. Головний герой Кремез &amp;mdash;&amp;nbsp;доброзичливий бульдозер, який разом зі своєю сім'єю виконує різноманітні будівельні місії та навчає цінності співпраці та творчості. Ідеальний варіант для маленьких любителів екшену та будівництва!






Кремез і команда: ігровий набір &amp;laquo;Будівельна команда&amp;raquo; - це унікальний набір, що містить&amp;nbsp;7 колекційних фігурок улюблених героїв, які перенесуть вашу дитину у світ, сповнений захоплюючих пригод.
До набору входять: Кремез, Мікс, Заряд, Мотор, Викрут, тітка Лебідка&amp;nbsp;і дідусь. Висота фігурок: 4,5-6 см. Кожна фігурка ретельно&amp;nbsp;деталізована та точно відтворює персонажів з мультфільму. Фігурки ідеально підходять для відтворення сцен з улюблених серій і&amp;nbsp;розвитку уяви та творчості вашої дитини.
Особливості набору &quot;Будівельна команда&quot;:

Комплектація:&amp;nbsp;7 різних фігурок в одній упаковці - ідеально підходить для колекціонування та гри;
Висока якість: фігурки виготовлені з міцних матеріалів і витримують інтенсивну гру;
Реалістичні деталі:&amp;nbsp;ретельно створені фігурки точно&amp;nbsp;повторюють&amp;nbsp;улюблених персонажів;
Розвиток уяви: ідеально підходить для творчих ігор і&amp;nbsp;створення власних пригод.
Ідеальний подарунок:&amp;nbsp;чудова ідея подарунка для будь-якого маленького шанувальника Кремеза&amp;nbsp;і його родини - команди будівельників.

Досліджуйте захоплюючі рятувальні місії з&amp;nbsp;Бумером та його великим рятувальним автомобілем - трансформером (серія Мега колеса).
Бумер&amp;nbsp;- це новий&amp;nbsp;герой команди Щенячий патруль, що обожнює бути в центрі уваги і піде на все, щоб стати героєм.&amp;nbsp;
Бумер&amp;nbsp;одягнений в шолом та&amp;nbsp;оливкову&amp;nbsp;форму з зеленими деталями в стилі Rescue Wheels&amp;nbsp;і виймається з автомобіля. Рятувальний автомобіль-трансформер оснащений величезними колесами і висувною лебідкою та створений для швидкої допомоги в будь-яких умовах &amp;ndash; на дорогах або бездоріжжі.&amp;nbsp;Коли друзі потрапили в біду, потягніть рукою буксирний трос, зачепіть гаком за предмет, а потім натисніть кнопку втягування мотузки, щоб здійснити вражаючий порятунок!&amp;nbsp;
До набору входять:

1 рятувальний автомобіль;
1 фігурка цуценяти Бумера.

Іграшки &amp;laquo;Щенячий патруль&amp;raquo; - чудовий подарунок для хлопчиків і дівчаток,&amp;nbsp;які є фанатами&amp;nbsp;відважних цуценят і обожнюють веселі та динамічні пригоди разом з командою рятувальників!

Іграшки Spin Master Gabby's Dollhouse занурюють дошкільнят у фантастичний котосвіт &quot;Ляльковий будиночок Габбі&quot; та дарують захоплюючу гру.
&quot;Стильна лялька Габбі&quot; висотою приблизно 20 см допоможе втілити свої власні казкові історії з популярного мультсеріалу. Габбі одягнена в своє улюблене вбрання: стильна куртка, джинси з нашивками для кошенят і справжні кросівки. Вона також носить котовушка, які можна зняти.
Лялечка Габбі має м'яке кучеряве волосся, яке можна укладати. Завдяки своєму оригінальному вигляду ця красуня неодмінно стане ідеальним компаньйоном для втілення своїх неймовірних пригод.
Особливості іграшки:

Стильна лялька Габбі має модне вбрання та аксесуари;
У ляльки надзвичайно м&amp;rsquo;яке кучеряве волосся, яке добре піддається укладці;
Лялька Габбі має фірмові зйомні котовушка;
Розміри ляльки: приблизно 20 см.

Рекомендований вік: від 3 років.

Трансформер-малюк робокар Ембер &amp;ndash; це машинка швидкої допомоги, що має компактні розміри та легко трансформується.
Ембер надзвичайно розумна і ерудована. Вона завжди підкаже та знайде ефективні рішення порятунку в надзвичайних ситуаціях. Завдяки вмілому користуванню медичними інструментами, вона має високе почуття відповідальності у наданні першої допомоги та захисті безпеки мешканців.
Іграшка має ряд переваг:

Трансформер-малюк робокар Ембер перетворюється з машини швидкої допомоги на робота і навпаки всього за 4 кроки;
машинка їздить надзвичайно плавно та маневренно;
матеріал моделі міцний, безпечний, не шкодить здоров'ю;
зручний розмір,&amp;nbsp;легко&amp;nbsp;трансформувати та грати.

Робокар є не тільки розважальною іграшкою, але й допомагає дітям здобувати навички вирішення проблем, розвивати дрібну моторику та координацію рук і очей.
Збирайте всю колекцію робокарів, щоб грати було ще цікавіше!

Хто любить скретч-арт&amp;nbsp;А хто обожнює моду&amp;nbsp;Make it Real об&amp;rsquo;єднав 2 захоплення, які чудово доповнили одне-одного!&amp;nbsp;
Набір для скретчінгу &amp;laquo;Крутий вайб&amp;raquo; від Make it Real&amp;nbsp;- це блокнот, в якому частина сторінок з моделями мають захисне покриття, яке необхідно обережно видалити паличкою, що йде в наборі. Відкрий весь образ або лише його частину.&amp;nbsp;Традиційні розмальовки з модними принтами доповнюють дизайнерський шаблон для створення неповторних образів.&amp;nbsp;
Використовуйте вузький кінець палички для дрібних деталей і широку сторону для рівномірного видалення покриття з великих поверхонь. Обережно подряпайте, відкривши необхідні елементи одягу, а потім доповніть наклейками на свій смак. Рекомендовано для дівчат від 8 років.
До набору входить:

3 модні скретч-сторінки з захисним покриттям;
30 сторінок-розмальовок;
1 аркуш наклейок з покриттям;
1 аркуш звичайних наклейок,
1 скретч-паличка.

Неймовірний набір для творчіх дівчаток від 8 років. Підкорює з першої сторінки!

Набір для макіяжу губ &amp;laquo;Телефон&amp;raquo; - це набір блисків для губ, що пахнуть полуницею та зберігаються в кейсі у вигляді мобільного телефону. Його можна прикрасити стразами і наклейками та доповнити шнурочком для зручного носіння.&amp;nbsp;Все необхідне для цього входить в комплект. Телефон-розкладачка містить 7 відтінків блиску для губ, а пензлик для нанесення зручно зберігається в антені.&amp;nbsp;Підходить для дітей від 6 років.
До набору входять:

Палетка блисків для губ у вигляді телефона, що розкладається;
7 блисків для губ з ароматом полуниці;
Пензлик для нанесення блиску;
1 шнурочок довжиною 50 см;
45 різноманітних намистин;
1 аркуш страз;
1 інструкція.

Набір блисків для губ, що зберігаються у розкладному телефоні, прикрашеному стразами&amp;hellip; Звучить дуже стильно! 
Make it real &amp;ndash; це безпечна косметика, створена для справжніх модниць віком від&amp;nbsp;6 років!

Набір для нейл-арту &quot;Цукерка&quot; &amp;ndash; це найприємніший спосіб зробити манікюр та педікюр!&amp;nbsp;Готові дизайни, наклейки, лаки для нігтів з ароматом ванілі та стрази подарують неймовірне задоволення від процесу.&amp;nbsp;
До набору входять:

2 лаки для нігтів з ароматом ванілі;
1 пилочка для нігтів;
12 накладних нігтів з ароматом ванілі;
1 аркуш наклейок для нігтів;
1 аркуш страз для нігтів;
1 аркуш дизайнів для нігтів;
Інструкція.

Лаки для нігтів виготовлені на водній основі та безпечні для дітей від 8 років.&amp;nbsp;Ідеальний подарунок для юних красунь!

